import React from 'react';
import '../App.css';

function Homepage() {
  return (
    <div className='background px-4'>
      <div className='items-center'> 
        <button >
          <a href='../pages/Plantdetails'>Explore Plants</a>
        </button>
        <button>
          <a href='../pages/About'>About us</a>
        </button>
      </div>
    </div>
  )
}

export default Homepage
